(function(){'use strict';var module=angular.module('app.company',['ui.router','ngResource','app.resource','app.common']);module.config(appConfig);appConfig.$inject=['$stateProvider'];function appConfig($stateProvider){var vm=this;$stateProvider.state('app.company',{url:'/company/:name',templateUrl:'app/modules/entities/company/list/company.html',resolve:{company:['$stateParams','companyResource','$http',function($stateParams,companyResource,$http){return companyResource.query().$promise.then(function(company){return company;});}],organization:['$stateParams','organizationResource','$http',function($stateParams,organizationResource,$http){return organizationResource.query().$promise.then(function(organization){return organization;});}]},controller:'CompanyListController',controllerAs:'vm'}).state('app.editCompany',{url:'/company/edit/:id',templateUrl:'app/modules/entities/company/edit/edit.html',resolve:{data:['$stateParams','companyResource',function($stateParams,companyResource){return $stateParams.id?companyResource.get({id:$stateParams.id}).$promise:{};}],organization:['$stateParams','organizationResource','$http',function($stateParams,organizationResource,$http){return organizationResource.query().$promise.then(function(organization){return organization;});}]},controller:'CompanyController',controllerAs:'vm'});}})();